create database info_ai;
CREATE TABLE autor
(
    id         serial       NOT NULL,
    name       varchar(50)  NOT NULL,
    email      varchar(50)  NOT NULL unique,
    password varchar(100) NOT NULL,
    CONSTRAINT pk_autor PRIMARY KEY (id)
);
insert into autor (name, email, password) values ('admin','admin@gmail.com', 'admin');
CREATE TABLE information
(
    id            serial      NOT NULL,
    title         varchar(50) NOT NULL,
    date_creation timestamp DEFAULT CURRENT_TIMESTAMP,
    content       text        NOT NULL,
    image         text,
    id_autor      integer     NOT NULL,
    CONSTRAINT pk_information PRIMARY KEY (id),
    CONSTRAINT fk_information_autor FOREIGN KEY (id_autor) REFERENCES autor (id)
);

alter table information add column state varchar(1) check ( state in ('t','f')) default 'f';

CREATE TABLE publication
(
    id_info   integer NOT NULL unique,
    date_move timestamp DEFAULT CURRENT_TIMESTAMP,
    state   varchar(10) check (state in ('removed', 'actif')),
    CONSTRAINT fk_publication_information FOREIGN KEY (id_info) REFERENCES information (id)
);
ALTER TABLE publication
    ADD CONSTRAINT nom_contrainte UNIQUE (id_info);

